// Sign Up Roles
interface Roles {
  title: string;
  description: string;
  role1: string;
  role2: string;
  role3: string;
  role4: string;
  role5: string;
  role6: string;
}

export const InterestsRoles = (rolesData: Roles) => {
  console.log(rolesData);
  return (
    <>
      <p className="sign-up-title">{rolesData.title}</p>
      <p className="sign-up-description">{rolesData.description}</p>
      <input
        className="form-input"
        placeholder={rolesData.role1}
        type="checkbox"
      ></input>
    </>
  );
};
